import logo from './logo.svg';
import './App.css';
import './index.css';
import ReactSearchBox from 'react-search-box'





function App() {
  return (
    <div className="App">
      <button className = "loginButton">Login</button>

      <p className="helloWorld">
        Hello World
      </p>

      <ReactSearchBox
        placeholder="Placeholder"
        value="Doe"
        data={this.data}
        callback={(record) => console.log(record)}
      />

    </div>


  );
}

export default App;
